import { Nav, Navbar, Form, FormControl, Container, NavDropdown, Button } from 'react-bootstrap';
import { useState, useContext } from 'react';
import { ModeContext } from './ModeContext';
import { LanguageContext } from './LanguageContext copy';
function Header() {

  // const value= useContext(ModeContext);
  const [show, setShow] = useContext(ModeContext);
  const [language, setLanguage]= useContext(LanguageContext);
  function handleShow() {
    setShow(true);
  }

  return (<div className='header'>
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
      <Container>
        <Navbar.Brand href="#home">{language.header.title}</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#services">Our Services</Nav.Link>
            <Nav.Link href="#about">About Us</Nav.Link>
            <Nav.Link href="#contact">Contact Us</Nav.Link>
            <NavDropdown title="Language" id="nav-dropdown">
              <NavDropdown.Item eventKey="4.1">عربي</NavDropdown.Item>
              <NavDropdown.Item eventKey="4.2">English</NavDropdown.Item>
            </NavDropdown>
          </Nav>
          <Nav  >
            <Nav.Link href="#" ><Button onClick={handleShow} >Ourder Now</Button></Nav.Link>
            <Nav.Link href="tel:0588402232"><Button>Call: 0588402232</Button></Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  </div>

  );
}

export default Header;
